import React from 'react';
import { Link } from 'react-router-dom';
import './Pagination.scss';
import Paginations from '@mui/material/Pagination';
import Stack from '@mui/material/Stack';

const Pagination = ({ notesPerPage, totalNotes, paginates }) => {
  const pageNumbers = [];
  
  for (let i = 1; i <= Math.ceil(totalNotes / notesPerPage); i++) {
    pageNumbers.push(i);
  }

  return (
    // <nav>
    //   <ul className='pagination'>
        // {pageNumbers.map(number => (
        //   <li key={number} className='page-item'>
        //     <Link onClick={() => paginates(number)} to='/' className='page-link'>
        //       {number}
        //     </Link>

        //   </li>
        // ))}
    //   </ul>
    // </nav>
    <Stack spacing={2}>
      {
        pageNumbers.map(number => (
          <Paginations onClick={() => paginates(number)} to='/' count={10} color="primary" />
        ))
      }
    </Stack>
  );
};

export default Pagination;
